import "./porfolio.scss";

function Portfolio() {
  return (
    <div className="portfolio" id="portfolio">
      <h1>Portfolio</h1>
      <ul>
        <li>Featured</li>
        <li>Web App</li>
        <li>Mobile App</li>
        <li>Design</li>
        <li>Branding</li>
      </ul>
      <div className="container">
        <div className="item">
          <img src="https://blog.hubspot.com/hubfs/To_Do_List.png" alt="" />
          <h3>To-do List</h3>
        </div>
      </div>
    </div>
  );
}

export default Portfolio;
